import Hero from "./Hero";
const About = () => {
  return (
    <>
      <Hero className="pt" text="About this application" />

      <div className="container">
        <div className="row">
          <div className="col m-5 lead">
            <p>
              Content covering all the information you need about this
              application
            </p>
          </div>
        </div>
      </div>
    </>
  );
};

export default About;
